import React from "react";
import { AppRouter } from "./AppRouter";
import Theme from "./components/themes/defaultTheme";
import { BrowserRouter } from "react-router-dom";

export const App = () => {
  return (
    <BrowserRoute basename="" r>
      <Theme>
        <AppRouter />
      </Theme>
    </BrowserRoute>
  );
};

export default App;
